$(function(){var a="http://localhost:8888";$("#tabs").tabs();$("button").button();$(".photos-container img").tooltip();$("input[type='radio']").checkboxradio();$(".photos-container a").click(function(c){c.preventDefault();var b=$(this);$.ajax({url:a+"/admin/photo/delete/"+ +b.attr("alt"),type:"GET",success:function(d){if(d){b.parent().hide("fade")}},timeout:30000})});$(".categories-item").click(function(c){c.preventDefault();var b=$(this);$.ajax({url:a+"/admin/category/delete/"+ +b.attr("alt"),type:"GET",success:function(e,d){console.log(d);console.log("suss");if(e){b.hide("fade")}},error:function(d){if(d.status==500){alert("To this category still belongs some photos")}},timeout:30000})});$(".main-img-container").click(function(c){var b=$(this),d=b.siblings(".backstage-photos");if(d.hasClass("expanded")){d.slideUp(300);d.removeClass("expanded")}else{d.slideDown(300);d.addClass("expanded")}});$(".main-img-container a").click(function(c){c.preventDefault();var b=$(this);$.ajax({url:a+"/admin/backstage/delete/"+ +b.attr("alt"),type:"GET",success:function(d){if(d){b.parent().parent().hide("fade")}},timeout:30000})})});